fields.save_fun:
def save(form, rep):
    if not rep.parent:
        test = False
        linia = form.cleaned_data['nag1']
        l = linia.split('/', 2)
        if len(l)==3:
            m = OrgChartElem.objects.filter(code=l[1], type='M', parent__code=l[0])
            if m.count()==1:
                d = DocHead.objects.filter(pk=rep.order).update(description=form.cleaned_data['nag2'], number=form.cleaned_data['st1'], org_chart_parent = m[0])
                test = True
        if not test:
            d = DocHead.objects.filter(pk=rep.order).update(description=form.cleaned_data['nag2'], number=form.cleaned_data['st1'])
    data = form.cleaned_data
    return data

