fields.save_fun:
def save(form, rep):
    import base64
    from PIL import Image
    import io

    def _encode(bstr, dopasuj, view_type, lp):
        img = Image.open(io.BytesIO(bstr))
        max_dx = _dx = 300
        max_dy = _dy = 300
        if view_type=='1111':
            max_dx = 2*_dx
            max_dy = 2*_dy
        elif view_type=='1122':
            max_dx = 2*_dx
        elif view_type=='1212':
            max_dy = 2*_dy
        elif view_type=='1123' and lp==1:
            max_dx = 2*_dx
        elif view_type=='1213' and lp==1:
            max_dy = 2*_dy

        max_size = max(img.size[0]/max_dx, img.size[1]/max_dy)
        min_size = min(img.size[0]/max_dx, img.size[1]/max_dy)
        if dopasuj:
            scale = min_size
        else:
            scale = max_size
        print("X1:", scale, max_size, min_size)
        if scale>1:
            img = img.resize((int(img.size[0]/scale), int(img.size[1]/scale)), Image.ANTIALIAS)
            if dopasuj:
                left = (img.size[0] - max_dx)/2
                top = (img.size[1] - max_dy)/2
                right = (img.size[0] + max_dx)/2
                bottom = (img.size[1] + max_dy)/2
                img = img.crop((left, top, right, bottom))    
        img2 = Image.new('RGB', (max_dx, max_dy), (255,255,255))
        offset = (int((max_dx - img.size[0]) / 2), int((max_dy - img.size[1]) / 2))
        img2.paste(img, offset)
        img = img2

        img_out = io.BytesIO()
        img.save(img_out, format='JPEG')
        return base64.b64encode(img_out.getbuffer()).decode('utf-8')

    ret = {}
    view_type = form.cleaned_data['view_type']
    for obrazek, dopasuj, lp in [('obrazek1', 'dopasuj1', 1), ('obrazek2', 'dopasuj2', 2), ('obrazek3', 'dopasuj3', 3), ('obrazek4', 'dopasuj4', 4)]:
        if form.cleaned_data[obrazek]:
            ret[obrazek] = _encode(form.cleaned_data[obrazek].read(), not form.cleaned_data[dopasuj], view_type, lp)
        else:
            ret[obrazek] = None
    ret['view_type'] = view_type
    ret['opis'] = form.cleaned_data['opis']

    return ret

